(function () {

  /**  generate placehold template **/
  var WHITE_ICON = "url('data:image/svg+xml;base64,')";

  var BLACK_ICON = "url('data:image/svg+xml;base64,')";

  var WHITE_TEXT = " url('data:image/svg+xml;base64,')";

  var BLACK_TEXT = "url('data:image/svg+xml;base64,')";

  var RED_BG = "linear-gradient(to bottom, #9f041b, #d84f5c 50%, #9f041b)";
  var BLACK_BG = "linear-gradient(to bottom, #272727, #4b4b4b 50%, #1b1b1b)";
  var WHITE_BG = "linear-gradient(to bottom, #d5d5d5, #ffffff 53%, #dbdbdb)";

  var bliss_button_template = document.createElement('a');
  bliss_button_template.href = "/bliss.php";
  bliss_button_template.style.display = "inline-block";
  bliss_button_template.style.minHeight = "40px";
  bliss_button_template.style.minWidth = "120px";
  bliss_button_template.style.borderRadius = "40px";
  bliss_button_template.style.marginTop = "16px";
  bliss_button_template.style.marginBottom = "16px";
  bliss_button_template.style.background = RED_BG;

  var bliss_button_icons = document.createElement('div');
  bliss_button_icons.style.display = "inline-block";
  bliss_button_icons.style.verticalAlign = "middle";
  bliss_button_icons.style.width = "60px";
  bliss_button_icons.style.height = "20px";
  bliss_button_icons.style.marginTop = "16px";
  bliss_button_icons.style.marginLeft = "24px";
  bliss_button_icons.style.marginRight = "10px";
  bliss_button_icons.style.marginBottom = "16px";
  bliss_button_icons.style.backgroundImage = WHITE_ICON;
  bliss_button_icons.style.backgroundRepeat = "no-repeat";
  bliss_button_icons.style.backgroundSize = "auto 100%";

  var bliss_button_text = document.createElement('div');
  bliss_button_text.style.display = "inline-block";
  bliss_button_text.style.verticalAlign = "middle";
  bliss_button_text.style.marginTop = "4px";
  bliss_button_text.style.width = "210px";
  bliss_button_text.style.height = "16px";
  bliss_button_text.style.backgroundImage = WHITE_TEXT;
  bliss_button_text.style.backgroundRepeat = "no-repeat";
  bliss_button_text.style.backgroundSize = "auto 100%";

  /** replace template **/
  var bliss_buttons_list = document.querySelectorAll('.bliss-btn');

  for (var i = 0; i < bliss_buttons_list.length; i++) {
    var bliss_button_placeholder = bliss_button_template.cloneNode();
    var bliss_button_icons_placeholder = bliss_button_icons.cloneNode();
    var bliss_button_text_placeholder = bliss_button_text.cloneNode();

    if (bliss_buttons_list[i].classList.contains('red')) {
      bliss_button_icons_placeholder.style.backgroundImage = WHITE_ICON;
      bliss_button_text_placeholder.style.backgroundImage = WHITE_TEXT;
      bliss_button_placeholder.style.background = RED_BG;
    } else if (bliss_buttons_list[i].classList.contains('white')) {
      bliss_button_icons_placeholder.style.backgroundImage = BLACK_ICON;
      bliss_button_text_placeholder.style.backgroundImage = BLACK_TEXT;
      bliss_button_placeholder.style.background = WHITE_BG;
    } else if (bliss_buttons_list[i].classList.contains('black')) {
      bliss_button_icons_placeholder.style.backgroundImage = WHITE_ICON;
      bliss_button_text_placeholder.style.backgroundImage = WHITE_TEXT;
      bliss_button_placeholder.style.background = BLACK_BG;
    }

    bliss_button_placeholder.appendChild(bliss_button_icons_placeholder);
    bliss_button_placeholder.appendChild(bliss_button_text_placeholder);
    bliss_buttons_list[i].replaceWith(bliss_button_placeholder);
  }

  /** If bliss result **/
  var GET = {
    bliss_return: false,
    result: false,
  };

  location.search.replace('?', '').split('&').forEach((el) => {
    var tmp = el.split('=');
    switch (tmp[0]) {
      case 'bliss_return':
        GET.bliss_return = true;
        break;
      case 'bliss_result':
        GET.bliss_result = (tmp[1] == 1);
        break;
    }
  });

  if (!GET.bliss_return) return;

  /* create elements */
  var modal_button = document.createElement('div');
  var modal_text = document.createElement('div');
  var modal_window = document.createElement('div');
  var modal = document.createElement('div');

  /** add styles for button **/
  modal_button.style.display = "block";
  modal_button.style.border = "1px solid rgba(70, 70, 70, .3)";
  modal_button.style.lineHeight = "1em";
  modal_button.style.padding = "8px 0";
  modal_button.style.textAlign = "center";
  modal_button.style.color = "rgba(70, 70, 70, .8)";
  modal_button.style.fontSize = "90%";
  modal_button.style.textTransform = "uppercase";
  modal_button.style.borderRadius = "6px";
  modal_button.style.cursor = "pointer";
  modal_button.style.marginTop = "12px";
  modal_button.innerHTML = "ok";
  modal_button.addEventListener('click', function () {
    location.href = location.origin + location.pathname;
  });

  /** add styles for text **/
  modal_text.innerHTML = ((GET.bliss_result) ? "  !" : "  ");

  /** add styles for modal **/
  modal_window.style.display = "block";
  modal_window.style.position = "absolute";
  modal_window.style.zIndex = "1000";
  modal_window.style.left = "50%";
  modal_window.style.top = "50%";
  modal_window.style.padding = "84px 32px 16px 32px";
  modal_window.style.width = "30%";
  modal_window.style.minWidth = "320px";
  modal_window.style.maxWidth = "560px";
  modal_window.style.backgroundColor = "#fff";
  modal_window.style.backgroundImage = "url('data:image/png;base64,')";
  modal_window.style.backgroundRepeat = "no-repeat";
  modal_window.style.backgroundPosition = "16px 16px";
  modal_window.style.backgroundSize = "42px auto";
  modal_window.style.textAlign = "center";
  modal_window.style.lineHeight = "1.3em";
  modal_window.style.borderRadius = "6px";
  modal_window.style.transform = "translate(-50%, -50%)";

  /** add styles for container **/
  modal.style.display = "block";
  modal.style.position = "fixed";
  modal.style.zIndex = "500";
  modal.style.background = "rgba(0, 0, 0, .6)";
  modal.style.top = "0";
  modal.style.left = "0";
  modal.style.right = "0";
  modal.style.bottom = "0";

  modal_window.append(modal_text);
  modal_window.append(modal_button);
  modal.append(modal_window);

  document.querySelector('body').append(modal);
})();
